import React from 'react'

function Home() {
    const postData = () => {
   var v=localStorage.getItem("user");
   const { uid,  gender, age,location} = v;
   const  receiver = "raju";

   fetch("http://localhost:4001/transaction/broadcast", {
    method: "post",
    mode: 'no-cors',
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
     uid,receiver,location,age,gender
    }),
  })
    .then((res) => res.json())
    .then((data) => {
      console.log(data);
      } 
        ).catch((err)=>{console.log(err)});
 
    }
    return (
        <div>
           <button onClick={()=>postData()} >test1</button>
        </div>
    )
}

export default Home
